import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <Fragment>
        <Header className='top'>
          <h1>Catch o the Day</h1>
          <h3 className='tagline'>
            <span>Fresh Daily</span>
          </h3>
        </Header>
      </Fragment>
    );
  }
}

export default Header;
